import React from 'react';
import styles from './Login.module.css';
import {useState} from 'react';
import { Formik } from 'formik';
function Login(){
    
    return (
        <div className={`container-fluid ${styles.loginFluid}`}>
            <Formik

                initialValues={{
                    email:'',
                    password:'',
                    remember_me:''
                }}
                onSubmit={
                    values=>{}
                }
            >
                {
                    props=>{
                        const {values,
                            errors,
                            touched,
                            handleChange,
                            handleBlur,
                            handleSubmit,
                            isSubmitting}=props;
                        
                        return (
                            <form   className={styles.login}>
                <div className="row">
                <h1 className="text-center">Đăng nhập</h1>
                <div className="mb-3">
                    <label htmlFor='email' className="form-label">Email address</label>
                    <input 
                    type="email"
                     className="form-control" 
                     name='email'
                      placeholder="name@example.com"
                      />
                </div>
                <div className="mb-3">
                    <label htmlFor='p1' 
                    className="form-label">Password</label>
                    <input type="text" 
                    className="form-control"
                     name='p1'
                      placeholder="VD:Kienkekek13@"
                      />
                </div>
                <div className="f-ck form-check">
                    <input className="CK form-check-input" type="checkbox" value="" id="invalidCheck2" required/>
                <label className="form-check-label" >
                    Agree to terms and conditions
                </label>
                </div>
                <div className="text-center mb-3">
                <button type="submit" className="Lgin btn btn-success">Đăng nhập</button>
                </div>
                </div>
            </form>
                        )
                    }
                }
            </Formik>
        </div>
    )
}

export default (Login);
